import { React } from 'react';
import styles from './userdata.module.css'

export const ConcreateUserData = (props) => {
    return (
        <div className={styles.concreate_user}>
            <p className={`header ${styles.concreate_name}`}>Username {props.Username}</p>
            <p className={`header ${styles.concreate_age}`}>Age {props.Age}</p>
        </div>
    );
}
